import React from "react";
import ReactDOM from "react-dom";
const fname = "Rishabh";
const lname = "Maurya";

ReactDOM.render(
  <>
   <h1> {`My Name is ${fname} ${lname} `} </h1>
   <p contentEditable="true"> My Birthday is on {10 + 3 } september </p>
  </>,
  document.getElementById('root') );
